(44, 'Turriff A2B service', 'Door to door service for those unable to use conventional PT.', 3, 'All journeys must be pre-booked by calling the dial-a-bus hotline on 01224 665599 between 9.30am and 3.30pm, Monday to Friday. To cancel a journey, please leave a message on the A2B cancellation line on 01224 665580, available 24 hrs a day', '0', NULL, NULL, '2015-05-06 12:43:09', NULL),
